GeneralComments:
Hotel Romantic offers a free charging point for our customers. Station: Home Box 22kW, Mode 2/3, Scame (Type 2) and Schuko (220 socket). Hotel is open 24/7. If you need any assistance please enter the hotel and talk to the reception or call +370 616 16170, +370 455 84860 www.romantic.lt, www.etnospa.lt. 

 While Your car is charging we offer:
•	to stay and have a good rest at our 4+ star hotel;
•	have a delicious meal in our restaurant or a cup of coffee;
•	relax in our unique ETNO- SPA center;
•	charge your own battery in our gym;
•	walk through the old town of Panevezys and enjoy the beautiful view.  

For any additional information visit www.romantic.lt or call +370 616 16170, +370 455 84860
